using Security;
using System;
using UnityEngine;

public class DeviceEmulatorInspector : MonoSingleton<DeviceEmulatorInspector>
{
	public const string OverdueMMSHex = "";

	public const string DefaultMMSHex = "";

	[SerializeField]
	private bool useDeviceEmulation;

	[SerializeField]
	private bool useOverdueMMS;

	[SerializeField]
	private bool useMMSService;

	[SerializeField]
	public string ESNNumber;

	[SerializeField]
	public MMSDataStructForInspector MmsDataStruct;

	public bool UseDeviceEmulation
	{
		get
		{
			return this.useDeviceEmulation;
		}
		set
		{
			this.useDeviceEmulation = value;
		}
	}

	public bool UseMMSService
	{
		get
		{
			return this.useMMSService;
		}
	}

	public bool UseOverdueMMS
	{
		get
		{
			return this.useOverdueMMS;
		}
	}

	public DeviceEmulatorInspector()
	{
	}

	public override void Awake()
	{
		if (!MonoSingleton<DeviceEmulatorInspector>.IsSingletonInitialized)
		{
			base.Awake();
			if (this.mDontDestroy)
			{
				DontDestroyOnLoad(base.gameObject);
			}
			this.InitializeStaticData();
		}
		else if (base.gameObject != MonoSingleton<DeviceEmulatorInspector>.GetSingleton().gameObject)
		{
			Destroy(base.gameObject);
		}
	}

	public void InitializeStaticData()
	{
		this.MmsDataStruct.SMembershipExpireDate = this.MmsDataStruct.mMembershipExpireDate;
		this.MmsDataStruct.SMembershipPackDate = this.MmsDataStruct.mMembershipPackDate;
		this.MmsDataStruct.FeatureFlags = this.MmsDataStruct.mFeatureFlags.GetBitArray();
	}

	private void OnEnable()
	{
		this.Awake();
	}

	public void Update()
	{
		this.UpdateNonstaticData();
	}

	private void UpdateNonstaticData()
	{
	}
}